import React, { Component } from "react";
import "./banner.css"

export default class Banner extends Component{
    constructor(props){
        super(props);
        this.state = {
            resume : false
        }
    }

    render() {
        return (
        <div id="banner">
            <div id="logo">
                <h1>Kasa</h1>
            </div>
            <div id="links">
                <a class="link" href="">Accueil</a>
                <a class="link" href="">A Propos</a>
            </div>
        </div>
        )
    }
}
